import PropTypes from "prop-types";
import styles from "./Button.module.css";
function Button({ text }) {
  return (
    <button
      className="btn"
      style={{
        backgroundColor: "red",
        color: "white",
      }}
    >
      {text}
    </button>
  );
}
Button.propTypes = {
  text: PropTypes.string.isRequired,
};

export default Button;
